function downloadCardPDF() {
    var progress = {
        pageSize: 'LETTER',

        pageOrientation: 'landscape',
        content: [
            {
                columns: [
                    {
                        width: 80,
                        "fontSize": 40,
                        bold: true,
                        text: 'I',
                        margin: [14, 0, 0, 0]
                    },
                    {
                        width: '*',
                        text: 'Last Name',
                        "fontSize": 20,
                        margin: [0, 8, 0, 0]
                    }
                ],
                columnGap: 3
            },
            {
                columns: [
                    {
                        width: 500,
                        "fontSize": 16,
                        bold: true,
                        text: 'Full Name',
                        margin: [90, 8, 0, 0]
                    },
                    {
                        width: 120,
                        text: 'Age',
                        "fontSize": 16,
                        margin: [16, 8, 0, 0]
                    },
                    {
                        width: '*',
                        text: '01/01/0001',
                        "fontSize": 16,
                        margin: [14, 8, 0, 0]
                    }
                ],
                columnGap: 3
            }
        ],
        background: [
            {
                image: 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mP8Xw8AAoMBgDTD2qgAAAAASUVORK5CYII=',
                width: 792
            }
        ]
    };

    var certificate = {
        // a string or { width: number, height: number }
        pageSize: 'LETTER',

        // by default we use portrait, you can change it to landscape if you wish
        pageOrientation: 'landscape',
        content: [
            {
                text: 'name',
                margin: [137, 270, 10, 10],
                "fontSize": 30,
                bold: true,
                italics: true,
                alignment: 'center',
            },
            {
                columns: [
                    {
                        text: 'name',
                        margin: [220, 100, 10, 10],
                        "fontSize": 15,
                    },
                    {
                        text: 'dd/MM/yyyy',
                        margin: [80, 100, 10, 10],
                        "fontSize": 15,
                    },
                ]
            },
            {
                columns: [
                    {
                        text: 'name',
                        margin: [220, 30, 10, 10],
                        "fontSize": 15,
                    },
                    {
                        text: 'dd/MM/yyyy',
                        margin: [80, 30, 10, 10],
                        "fontSize": 15,
                    },
                ]
            },


        ],
        background: [
            {
                image: 'data:image/jpeg;base64,',
                width: 792
            }
        ]
    };
    //var imgUrl = $('#Card').val();

    //get inputs
    var firstName = $('#FirstName').val();
    var lastName = $('#LastName').val();
    var inital = firstName.charAt(0);

    var fullName = firstName !== '' ? firstName + ' ' + lastName : lastName;
    var age = $('#Age').val();
    var startDate = $('#StartDate').val();
    var completionDate = $('#CompletionDate').val();

    var ctype = $('#CardType').val();
    var clevel = $('#CardLevel').val();

    var coach = $('#Coach').val();
    var aquaticDirector = $('#AquaticDirector').val();

    var docDefinition = {};
    var filename = "file";
    if (ctype === "0") {
        docDefinition = progress;
        filename = "ProgressCard";
        //assign to docdef
        docDefinition.content[0].columns[0].text = inital;
        docDefinition.content[0].columns[1].text = firstName;

        docDefinition.content[1].columns[0].text = fullName;
        docDefinition.content[1].columns[1].text = age;
        docDefinition.content[1].columns[2].text = startDate;

        if (clevel === "7" || clevel === "8") {
            docDefinition.content[0].columns[1].margin = [0, 12, 0, 0];

            docDefinition.content[1].columns[0].margin = [90, 32, 0, 0];
            docDefinition.content[1].columns[1].margin = [48, 32, 0, 0];
            docDefinition.content[1].columns[2].fontSize = 12;
            docDefinition.content[1].columns[2].margin = [47, 35, 0, 0];
        }
    }
    else {
        docDefinition = certificate;
        filename = "Certificate";
        //assign to docdef
        docDefinition.content[0].text = fullName;
        docDefinition.content[1].columns[0].text = coach;
        docDefinition.content[1].columns[1].text = completionDate;
        docDefinition.content[2].columns[0].text = aquaticDirector;
        docDefinition.content[2].columns[1].text = completionDate;
    }

    //docDefinition.background[0].image = imgUrl;

    $.ajax({
        async: true,
        type: "GET",
        cache: false,
        url: rootURL + "GetCard",
        data: { type: ctype, level: clevel }
    }).done(
        function (data, textStatus, jqXHR) {
            if (data.card) {
                docDefinition.background[0].image = data.card;
                //create Pdf
                pdfMake.createPdf(docDefinition).download(filename + ".pdf");
            }
            else {
                $.snackbar({ content: 'Error. Please check your inputs.', timeout: 10000 });
            }
        }
    );
}